import React from "react";
import StudentForm from "./components/StudentForm";
import StudentList from "./components/StudentList";

const App = () => {
  return (
    <div>
      <h1 className="text-center mt-3">Student Management System</h1>
      <StudentForm />
      <StudentList />
    </div>
  );
};

export default App;
